import React from "react";
import { connect } from "react-redux";
import { GetDataFromApi} from "../utils/session";
import { useState } from 'react';
import { useEffect } from "react"

const mapStateToProps = ({ session }) => ({
  session
});

const login = user => (
  fetch("api/session", {
    method: "POST",
    body: JSON.stringify(user),
    headers: {
      "Content-Type": "application/json"
    }
  })
);

function App ({ session }) {

  const [textAddValue, updateInput] = useState();
  const addNewText = () =>{
    if(!textAddValue){ 
      alert('input empty'); 
      return;
    } 
  }

  const [data, setData] = useState([]);
  useEffect(() => {
    GetDataFromApi(session.username)
    .then((response) => setData(response))
    .then(updateInput(data?.name));
  }, []);

  return (
    <div className="App">
        <div className="container">
            <div className="eleContainer">
              <input type="text" className="txtAdd" defaultValue={data?.name} onChange={(e)=>updateInput(e.target.value)}/>
              <button className="addNew" onClick={addNewText}>Add to Dictionary</button>
            </div>
        </div>
    </div>
  );
}
  export default connect(
    mapStateToProps
  )(App);
